import React from 'react';
import { NavLink } from 'react-router-dom';
import { request, setAuthHeader } from '../helpers/axios_helper';
import { toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

export const Navbar = () => {
  return (
    <nav className="bg-sky-600">
      <div className="max-w-screen-xl mx-auto text-white text-lg font-semibold">
        <ul className="flex">
          <li>
            <img className="h-20 p-2 mr-4" src={require('../pictures/gerb.png')} alt="Герб" />
          </li>
          <li className="hover:bg-sky-800 flex items-center px-2 ml-auto">
            <NavLink to="/login" className="h-full flex items-center">Войти
            <img className="h-8 mt-1 ml-1 mr-4" src={require('../pictures/login.png')} alt="Герб" />
            </NavLink>
          </li>
        </ul>
      </div>
    </nav>
  );
};
